			ctx.lineTo(xy0+dx1+bb[0],xy0+dy1+bb[1]);
			ctx.lineTo(xy0+dx1+cc[0],xy0+dy1+cc[1]);
			ctx.lineTo(xy0+dx1+dd[0],xy0+dy1+dd[1]);
			ctx.lineTo(xy0+dx1+ee[0],xy0+dy1+ee[1]);
			ctx.lineTo(xy0+dx1+aa[0],xy0+dy1+aa[1]);
